const app = getApp()

//传说有个魔仙堡，有个女王不得了

Page({
  onLoad(){
    var _this = this;
    wx.cloud.callFunction({
      name: "getImage",
      success(res){
        console.log("show1", res)
        _this.setData({
          photo: res.result.data
        })
      }
    })
    // this.data.photo = app.globalData.imageData
    // console.log("show1", app.globalData)
    // this.setData({
    //   photo: app.globalData
    // })
    // console.log("success", this.data.photo)
  },
  onShow: function () {
    // this.setData({
    //   photo: app.globalData.imageData
    // })
    console.log("success", app.globalData)
    // console.log("photo", this.data.photo)
  },

  scrollTouchstart: function (e) {
    let py = e.touches[0].pageY;
    console.log(py);
    this.setData({
      starty: py
    })
  },
  scrollTouchend: function (e) {
    let py = e.changedTouches[0].pageY;
    let d = this.data;
    this.setData({
      endy: py,
    })
    console.log(e.changedTouches[0].pageY, d.starty);
    if (py - d.starty > d.critical && d.scrollindex > 0) {
      this.setData({
        scrollindex: d.scrollindex - 1
      })
    } else if (py - d.starty < -(d.critical) && d.scrollindex < this.data.totalnum - 1) {
      this.setData({
        scrollindex: d.scrollindex + 1
      })
    }
    this.setData({
      starty: 0,
      endy: 0,
      margintop: 0
    })
  },
  data: {
    photo: null,
    scrollindex: 0,  //当前页面的索引值
    totalnum: 4,  //总共页面数
    starty: 0,  //开始的位置x
    endy: 0, //结束的位置y
    critical: 80, //触发翻页的临界值
    margintop: 0,  //滑动下拉距离
    image: "data:image/png;base64,"
  },

}) 
